import styled from "styled-components";

const Input = styled.input`
   border: 1px solid #ccc;
   border-radius: 4px;
   margin-bottom: 8px;
   box-sizing: border-box;
   height: 40px;
   width: 100%;
   font-size: 1em;
   padding: 4px;
   font-family:'Open Sans'
`;

export {Input};
